import React from 'react';
import {
    Box,
    Button
} from '@mui/material';

const aboutStyle = {
    width: '100%',
    display: 'block',
    color: 'white',
    backgroundColor: 'rgb(10, 33, 77)', //primary - doesn't want to import
    fontSize: '1.5rem',
    fontFamily: 'sans-serif',
    fontWeight: '600',
    borderRadius: 0,
    padding: '1.6rem',
    border: 'solid rgb(0, 0, 0) 3px',
        '&:hover': {
            backgroundColor: 'rgb(10, 33, 77)',
            border: 'solid white 3px',
            transition: '.3s'   
        }
}

const About = () => {

    return (
        <Box
            sx={{
                border:'solid black .30rem', //test
                // borderTop: 'solid black .45rem'
            }}
        >
            <Button
                sx={aboutStyle}
            >
                About Me
            </Button>
        </Box>
    );
};

export default About;
